import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Home from "./pages/Home";
import Layout from "./Layout/Layout";

function App() {
  return (
    <Router>
      <div className="App">
        <Layout>
          <Routes>
            <Route path="/" element={<Home></Home>} />

          </Routes>
        </Layout>
      </div>
    </Router>
  );
}

export default App;
